import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Tablet.css';

const Tablet = () => {
  const navigate = useNavigate();
  const [showQR, setShowQR] = useState(false);

  // Fonctions pour les boutons cliquables
  const handleCashOperations = () => {
    console.log('Cash Operations selected');
    navigate('/create-ticket?service=cash');
  };

  const handleCustomerService = () => {
    console.log('Customer Service selected');
    navigate('/create-ticket?service=customer');
  };

  const handleCorporateVIP = () => {
    console.log('Corporate/VIP selected');
    navigate('/create-ticket?service=corporate');
  };

  const handleCardsDigital = () => {
    console.log('Cards & Digital selected');
    navigate('/create-ticket?service=cards');
  };

  const handlePaperTicket = () => {
    console.log('Paper Ticket selected');
    navigate('/create-ticket?type=paper');
  };

  const handleVirtualTicket = () => {
    console.log('Virtual Ticket selected');
    navigate('/create-ticket?type=virtual');
  };

  return (
    <div className="tablet-container">
      {/* LIGNE 1: AGB */}
      <div className="line-1">AGB</div>

      {/* LIGNE 2: Welcome */}
      <div className="line-2">Welcome to AGB/Bienvenue chez AGB</div>

      {/* LIGNE 3: FR|EN|AR (cliquable) */}
      <div className="line-3">
        <button className="lang-btn">FR</button>
        <span className="lang-sep">|</span>
        <button className="lang-btn">EN</button>
        <span className="lang-sep">|</span>
        <button className="lang-btn">AR</button>
      </div>

      {/* LIGNE 4: Please select */}
      <div className="line-4">Please select your service/Veuillez choisir votre service</div>

      {/* LIGNE 5: Cash Operations (cliquable) */}
      <button className="service-btn service-main" onClick={handleCashOperations}>
        Cash Operations
      </button>

      {/* LIGNE 6: Verser/Retirer */}
      <div className="line-6">Verser/Retirer</div>

      {/* LIGNE 7: Paper Ticket (cliquable) */}
      <button className="ticket-btn" onClick={handlePaperTicket}>
        Paper Ticket
      </button>

      {/* LIGNE 8: TicketPapier (cliquable) */}
      <button className="ticket-btn" onClick={handlePaperTicket}>
        TicketPapier
      </button>

      {/* LIGNE 9: Virtual Ticket/ et Customer Service sur la même ligne */}
      <div className="line-9">
        <button className="virtual-link" onClick={handleVirtualTicket}>
          Virtual Ticket/
        </button>
        <button className="service-btn service-right" onClick={handleCustomerService}>
          Customer Service
        </button>
      </div>

      {/* LIGNE 10: TicketVirtuel et Conseiller Client sur la même ligne */}
      <div className="line-10">
        <button className="virtual-link" onClick={handleVirtualTicket}>
          TicketVirtuel
        </button>
        <span className="service-sub">Conseiller Client</span>
      </div>

      {/* LIGNE 11: Scan text et Corporate/VIP sur la même ligne */}
      <div className="line-11">
        <span className="scan-text">Scan this code to access</span>
        <button className="service-btn service-right" onClick={handleCorporateVIP}>
          Corporate/VIP
        </button>
      </div>

      {/* LIGNE 12: QONNEXEA text et Entreprises sur la même ligne */}
      <div className="line-12">
        <span className="qonnexea-text">QONNEXEA anl tatackyour turn</span>
        <span className="service-sub">Entreprises</span>
      </div>

      {/* LIGNE 13: in real-time et Cards &Digital sur la même ligne */}
      <div className="line-13">
        <span className="realtime-text">in real-time.</span>
        <button className="service-btn service-right" onClick={handleCardsDigital}>
          Cards & Digital
        </button>
      </div>

      {/* LIGNE 14: Cartes&E-Banking (aligné à droite) */}
      <div className="line-14">Cartes & E-Banking</div>

      {/* Section QR Code avec bouton cliquable */}
      <div className="qr-section">
        <button className="qr-button" onClick={() => setShowQR(!showQR)}>
          {showQR ? 'Hide QR Code' : 'Show QR Code'}
        </button>
        {showQR && (
          <div className="qr-display">
            <img 
              src={`https://api.qrserver.com/v1/create-qr-code/?size=150x150&data=${window.location.origin}/qonnexea`}
              alt="QR Code QONNEXEA"
            />
            <p className="qr-hint">Scan to access QONNEXEA</p>
          </div>
        )}
      </div>

      {/* Bouton Cancel/Return (cliquable) */}
      <button className="cancel-btn" onClick={() => window.history.back()}>
        Cancel / Return
      </button>
    </div>
  );
};

export default Tablet;
